    private List<Fooditem> GetItems(int isleNumber)
    {
        foreach (var GroceryIsle in groceryIsle)
        {
            if (GroceryIsle.isleNum == isleNumber)
            {
                currentIsle = GroceryIsle.isleName;
                return GroceryIsle.FoodList;
            }
        }
        return new List<Fooditem>();
